let i = 1;
let count = 0;
let tab = medicaments.map((entry) => {
    entry.id = i++
    let strReverse = entry.name.split(',');
    if (!strReverse[1]) {
        count ++
        console.log('---> ', entry.name);
    } else {
        entry.name = strReverse[0].trim();
        entry.type = strReverse[1].trim();
        if (entry.name.includes(' MG')) {
            entry.name = entry.name.replace(/ MG/i, 'mg')
        }
        if (entry.name.includes('MG ')) {
            entry.name = entry.name.replace(/MG /i, 'mg')
        }
        if (entry.name.includes(' / ')) {
            entry.name = entry.name.replace(' / ', '/')
        }
        
    }
    return entry;
});
